import React from 'react'
import Form from '../../components/Form/Form'
import Hero from '../../components/Hero/Hero'

function AddMovie({movies, setMovies}) {
    return (
        <div>
            <Hero />
            <Form movies={movies} setMovies={setMovies}/>
        </div>
    )
}

export default AddMovie
